import React, { useState } from "react";
import {
  View,
  Text,
  TextInput,
  TouchableOpacity,
  Alert,
  StyleSheet,
} from "react-native";
import { API_BASE_URL } from "../../utils/apiConfig";

const FindPasswordScreen = ({ navigation }) => {
  const [email, setEmail] = useState("");
  const [loading, setLoading] = useState(false);

  const handleSendCode = async () => {
    if (!email) {
      Alert.alert("Ïò§Î•ò", "Ïù¥Î©îÏùºÏùÑ ÏûÖÎ†•Ìï¥Ï£ºÏÑ∏Ïöî.");
      return;
    }

    setLoading(true);
    try {
      const response = await fetch(
        `${API_BASE_URL}users/password_reset/request/`,
        {
          method: "POST",
          headers: { "Content-Type": "application/json" },
          body: JSON.stringify({ email }),
        }
      );

      // ÏùëÎãµ ÌÉÄÏûÖ ÌôïÏù∏
      const contentType = response.headers.get("content-type");
      if (!contentType || !contentType.includes("application/json")) {
        const textResponse = await response.text();
        console.error("ÏÑúÎ≤Ñ ÏùëÎãµÏù¥ JSONÏù¥ ÏïÑÎãò:", textResponse);
        Alert.alert("Ïò§Î•ò", "ÏÑúÎ≤Ñ ÏùëÎãµ ÌòïÏãù Ïò§Î•ò");
        setLoading(false);
        return;
      }

      const data = await response.json();

      if (response.ok) {
        Alert.alert(
          "ÏÑ±Í≥µ",
          data.message || "ÎπÑÎ∞ÄÎ≤àÌò∏ Ïû¨ÏÑ§Ï†ï ÎßÅÌÅ¨Î•º Ïù¥Î©îÏùºÎ°ú Î≥¥ÎÉàÏäµÎãàÎã§.",
          [
            {
              text: "Îã§Ïùå",
              onPress: () =>
                navigation.navigate("ResetPassword", { email: email }),
            },
          ]
        );
      } else {
        Alert.alert("Ïò§Î•ò", data.message || "ÎπÑÎ∞ÄÎ≤àÌò∏ Ï∞æÍ∏∞Ïóê Ïã§Ìå®ÌñàÏäµÎãàÎã§.");
      }
    } catch (error) {
      console.error("üö® Network Error:", error);
      Alert.alert("Ïò§Î•ò", "ÎÑ§Ìä∏ÏõåÌÅ¨ Ïò§Î•òÍ∞Ä Î∞úÏÉùÌñàÏäµÎãàÎã§.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <View style={styles.container}>
      {/* üîô Îí§Î°ú Í∞ÄÍ∏∞ Î≤ÑÌäº */}
      <TouchableOpacity
        onPress={() => navigation.goBack()}
        style={styles.backButton}
      >
        <Text style={styles.backText}>{"<"}</Text>
      </TouchableOpacity>

      {/* üè∑ ÌÉÄÏù¥ÌãÄ */}
      <Text style={styles.title}>ÎπÑÎ∞ÄÎ≤àÌò∏ Ï∞æÍ∏∞</Text>

      {/* üìß Ïù¥Î©îÏùº ÏûÖÎ†• */}
      <Text style={styles.label}>Ïù¥Î©îÏùº</Text>
      <View style={styles.inputContainer}>
        <TextInput
          style={styles.input}
          placeholder="Í∞ÄÏûÖ Ïãú ÏÇ¨Ïö©Ìïú Ïù¥Î©îÏùº ÏûÖÎ†•"
          placeholderTextColor="#ccc"
          keyboardType="email-address"
          autoCapitalize="none"
          value={email}
          onChangeText={setEmail}
        />
        <TouchableOpacity
          style={[styles.sendButton, loading && styles.disabledButton]}
          onPress={handleSendCode}
          disabled={loading}
        >
          <Text style={styles.sendButtonText}>
            {loading ? "Ï†ÑÏÜ° Ï§ë..." : "Ï†ÑÏÜ°"}
          </Text>
        </TouchableOpacity>
      </View>

      <Text style={styles.infoText}>
        Í∞ÄÏûÖÌïòÏã† Ïù¥Î©îÏùºÎ°ú ÎπÑÎ∞ÄÎ≤àÌò∏ Ïû¨ÏÑ§Ï†ï ÎßÅÌÅ¨Í∞Ä Î∞úÏÜ°Îê©ÎãàÎã§.
      </Text>
    </View>
  );
};

// ‚úÖ Ïä§ÌÉÄÏùº Ï†ïÏùò
const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#003340",
    alignItems: "center",
    justifyContent: "center",
    paddingHorizontal: 30,
  },

  backButton: {
    position: "absolute",
    top: 50,
    left: 20,
    zIndex: 10,
  },
  backText: {
    fontSize: 36,
    color: "#F074BA",
  },

  title: {
    fontSize: 24,
    fontWeight: "bold",
    color: "#F074BA",
    position: "absolute",
    top: 150,
    left: 30,
  },

  label: {
    fontSize: 16,
    color: "#F074BA",
    alignSelf: "flex-start",
    marginTop: 10,
    marginBottom: 10,
  },

  inputContainer: {
    flexDirection: "row",
    alignItems: "center",
    width: "100%",
    borderWidth: 1,
    borderColor: "#ddd",
    borderRadius: 8,
    backgroundColor: "#f9f9f9",
    marginBottom: 10,
    paddingHorizontal: 10,
  },

  input: {
    flex: 1,
    height: 50,
    fontSize: 16,
    color: "black",
  },

  sendButton: {
    width: 60,
    height: 35,
    alignItems: "center",
    justifyContent: "center",
    backgroundColor: "#CCCDD0",
    borderRadius: 16,
    marginLeft: 10,
  },

  disabledButton: {
    backgroundColor: "#A0A0A0",
  },

  sendButtonText: {
    fontSize: 14,
    color: "black",
  },

  infoText: {
    fontSize: 14,
    color: "#F074BA",
    textAlign: "center",
    marginTop: 20,
    opacity: 0.7,
  },
});

export default FindPasswordScreen;
